import FormStyles from './styles/FormStyles';
import { useState } from 'react';

const CreateProduct = () => {
  const [name, setName] = useState('Emma');
  return (
    <FormStyles>
      <label htmlFor="name">
        Name
        <input
          type="text"
          id="name"
          name="name"
          placeholder="Name"
          value={name}
          onChange={e => setName(e.target.value)}
        />
      </label>
    </FormStyles>
  );
};

export default CreateProduct;
